import React from 'react';

const style = `
.btn-portfolio {
  height: 50px;
  min-width: 50px;
  width: 150px;
  border: 1px solid white;
  border-radius: 30px;
  color: white;
}
`;

const Buttons = ({ name,  }) => {
  return (
    <div className="btn-portfolio">
      {<div></div>}
      <div>Facebook</div>
      <style>{style}</style>
    </div>
  );
};

export default Buttons;
